import PersonIcon from '@mui/icons-material/Person';
import {IconButton} from "@mui/material";
import './Header.css';

function Header(){
    return (
        <div className="header">
            <IconButton>
                <PersonIcon fontSize="large" className="header__icon" />
            </IconButton>

            <img  />
        </div>
    )
}

export default Header;
